import react from 'react';
import './description.css';


const Description = () => {
    return (
        <div className='description_container'>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. 
                Donec commodo lacus vel efficitur blandit. 
                Sed ultricies tellus eget urna ultricies fringilla. 
                Duis tincidunt et tortor eu commodo. Etiam tempor ante purus, 
                tempor aliquet lorem elementum nec. In quis velit ipsum. 
                Donec nec metus odio. Cras ut arcu ac sem pellentesque euismod. 
                Mauris pretium tristique erat vitae vestibulum. 
                Nunc egestas porta nisl quis interdum.</p>
        </div>
    )
}

export default Description
